import numpy as np
import copy
import random

multSigmoid = 0.01

def m_sum(m):
    val=0
    for i in range(0, len(m)):
        val+=m[i]
    return val


def m_sub(m1, m2):
    if(len(m1)==len(m2)):
        tempArray=[]
        for i in range(0, len(m1)):
            tempArray.append(m1[i]-m2[i])
        return tempArray

def m_pow(m1, m2):
    tempArray=[]
    for i in range(0, len(m1)):
        tempArray.append(pow(m1[i], m2))
    return tempArray


def sigmoid(z):
    return 1.0/(1+np.exp(-multSigmoid*z))

def sigmoidArray(z):
    tempVar = []
    for i in range(0, len(z)):
        tempVar.append(sigmoid(z[i]))
    return tempVar

def inverseSigmoid(z):
    if z != 1:
        return (1.0/multSigmoid)*np.ln(z/(1-z))
    return "DNE"

def getMaxIndex(array):
    k = 0
    max = array[k]

    for i in range(0, len(array)):
        if array[i] > max:
            max = array[i]
            k = i

    return k

def getMax(array):
    k = 0
    max = array[k]

    for i in range(0, len(array)):
        if array[i] > max:
            max = array[i]
            k = i

    return max

